리고 지금은 없는 기진짱 그리고 다른 팀인 건형.. 미안.. 영상좀 쓸게~\"},{\"author\":\"aYifMw4yF8Re3GBtmlHETguD3yD2\",\"content\":\"코드몬스터 제영 아푸지마도토도토낙낙 식단알리미 예은 이름못외우는짤리 그냥몬스터 다연 모두 고생했고 회식30번 밀린거알쥐 ~ \"},{\"author\":\"k1PVQUplAeb9PZSvAB3Wf4rwLJq2\",\"content\":\"이거 열고나서 로얄라멘 또 가자 얘들아~ 너무 맛있었음~~ 근데 니들 툭하면 키로 분쟁 일으키는데 걍 똑같자나ㅋㅋㅋㅋㅋㅋㅋㅋㅋ -떡잎방범대 최장신-\"}],\"photo\":[{\"author\":\"bJmg0eO8dbgdsOm7jTMbx1pEYvZ2\",\"content\":\"12920/images/bJmg0eO8dbgdsOm7jTMbx1pEYvZ2.jpg\"},{\"author\":\"GLkKCvqBvzOTKbh5TRNoXFlqHtu1\",\"content\":\"12920/images/GLkKCvqBvzOTKbh5TRNoXFlqHtu1.jpg\"},{\"author\":\"tcHwjUMYQpM0010rFk9o27UcHSi1\",\"content\":\"12920/images/tcHwjUMYQpM0010rFk9o27UcHSi1.gif\"},{\"author\":\"Kcz09sGqW6NjDAmcqIiNQX9KlbF3\",\"content\":\"12920/images/Kcz09sGqW6NjDAmcqIiNQX9KlbF3.jpg\"},{\"author\":\"aYifMw4yF8Re3GBtmlHETguD3yD2\",\"content\":\"12920/images/aYifMw4yF8Re3GBtmlHETguD3yD2.jpg\"},{\"author\":\"k1PVQUplAeb9PZSvAB3Wf4rwLJq2\",\"content\":\"12920/images/k1PVQUplAeb9PZSvAB3Wf4rwLJq2.jpg\"}],\"audio\":[{\"author\":\"bJmg0eO8dbgdsOm7jTMbx1pEYvZ2\",\"content\":\"12920/audios/bJmg0eO8dbgdsOm7jTMbx1pEYvZ2.mp4\"},{\"author\":\"GLkKCvqBvzOTKbh5TRNoXFlqHtu1\",\"content\":\"12920/audios/GLkKCvqBvzOTKbh5TRNoXFlqHtu1.mp4\"},{\"author\":\"tcHwjUMYQpM0010rFk9o27UcHSi1\",\"content\":\"12920/audios/tcHwjUMYQpM0010rFk9o27UcHSi1.mp4\"},{\"author\":\"Kcz09sGqW6NjDAmcqIiNQX9KlbF3\",\"content\":\"12920/audios/Kcz09sGqW6NjDAmcqIiNQX9KlbF3.mp4\"},{\"author\":\"aYifMw4yF8Re3GBtmlHETguD3yD2\",\"content\":\"12920/audios/aYifMw4yF8Re3GBtmlHETguD3yD2.mp4\"}],\"video\":[{\"author\":\"bJmg0eO8dbgdsOm7jTMbx1pEYvZ2\",\"content\":\"12920/videos/bJmg0eO8dbgdsOm7jTMbx1pEYvZ2.mp4\"},{\"author\":\"GLkKCvqBvzOTKbh5TRNoXFlqHtu1\",\"content\":\"12920/videos/GLkKCvqBvzOTKbh5TRNoXFlqHtu1.mp4\"},{\"author\":\"tcHwjUMYQpM0010rFk9o27UcHSi1\",\"content\":\"12920/videos/tcHwjUMYQpM0010rFk9o27UcHSi1.mp4\"},{\"author\":\"Kcz09sGqW6NjDAmcqIiNQX9KlbF3\",\"content\":\"12920/videos/Kcz09sGqW6NjDAmcqIiNQX9KlbF3.mp4\"},{\"author\":\"aYifMw4yF8Re3GBtmlHETguD3yD2\",\"content\":\"12920/videos/aYifMw4yF8Re3GBtmlHETguD3yD2.mp4\"}]}','2022-11-18 05:46:52.816050',NULL,'{\"teamName\":\"떡잎방범대\",\"hostUid\":\"bJmg0eO8dbgdsOm7jTMbx1pEYvZ2\",\"member\":[{\"nickname\":\"연다\",\"uid\":\"bJmg0eO8dbgdsOm7jTMbx1pEYvZ2\"},{\"nickname\":\"옌\",\"uid\":\"GLkKCvqBvzOTKbh5TRNoXFlqHtu1\"},{\"nickname\":\"낙낙\",\"uid\":\"tcHwjUMYQpM0010rFk9o27UcHSi1\"},{\"nickname\":\"짤리\",\"uid\":\"Kcz09sGqW6NjDAmcqIiNQX9KlbF3\"},{\"nickname\":\"잠송\",\"uid\":\"aYifMw4yF8Re3GBtmlHETguD3yD2\"},{\"nickname\":\"영제\",\"uid\":\"k1PVQUplAeb9PZSvAB3Wf4rwLJq2\"}]}',_binary '',NULL,'자율 프로젝트를 기념하며',_binary '\0','2022-12-11 00:00:00.000000',_binary '\0'),(12924,'{\"text\":[{\"author\":\"tcHwjUMYQpM0010rFk9o27UcHSi1\",\"content\":\"어떤 만남은 특별한 인연의 끝으로 함께 가기도 하고\\n어떤 만남은 단 한번으로 끝나버리기도 하고\\n어떤 만남은 도중에 적이 되어버리기도 하고\\n어떤 만남은 오랜 공백에도 마치 어제 헤어진 사람처럼 정겹기도 합니다.\\n\\n어떤 만남은 욕심나는 사람인데도 소소한 이유들로 어색한 거리를 끝내 좁히지 못하기도 하고\\n어떤 만남은 때때로 그리움으로 기억되지만 단 한 번을 다시 마주치지 못하기도 합니다.\\n\\n수 많은 만남 속에 여러분들을 반짝 만나 내 삶의 한 장에 행복한 추억이 만들어졌습니다.\\n그래서 그것이 그저 스쳐가는 인연으로 끝날지라도 나는 감사해요.\\n이 세상에서 의미있는 여러분이 내 삶에 더해진 것만으로 나는 행복합니다.\"},{\"author\":\"aYifMw4yF8Re3GBtmlHETguD3yD2\",\"content\":\"안녕하세요 ^^\\n떡잎방범대 여자중 최장신입니다 ^^\\n우리 회식3번남았음\\n1. 돈방\\n2. 하루필름+봉명회식\\n3. 선아네집에서 배달쿠폰쓰기\\n냠냠냠냠찌들 ~ \"},{\"author\":\"bJmg0eO8dbgdsOm7jTMbx1pEYvZ2\",\"content\":\"우리팀 킹왕짱 우리팀이 최고다 !!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!자율 프로젝트 넘나 행복했다\"},{\"author\":\"k1PVQUplAeb9PZSvAB3Wf4rwLJq2\",\"content\":\"이거 열고나서 로얄라멘 또 가자 얘들아 너무 맛있었어~~~\\n근데 니들 툭하면 키로 분쟁 일으키는데 걍 똑같잖아ㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋㅋ\\n-떡잎방범대 최장신-\"},{\"author\":\"GLkKCvqBvzOTKbh5TRNoXFlqHtu1\",\"content\":\"다들 너무 즐거웠고 행복한 자율프로젝트였습니당~~ 이럴게 항상 웃고 재밌게 코딩 했던게 처음이었던 것 같아요~~!! 우리 앞으로 회식 엄청 많이 남은거 알죠?? 앞으로도 계속 연락하면서 지내자구요~~!!\"},{\"author\":\"Kcz09sGqW6NjDAmcqIiNQX9KlbF3\",\"content\":\"열심히 디버깅 중인 제영씌 뒤에서 열심히 보는 척 하며 장난치고 있는 예은이.. 너무 귀엽고 사랑스럽다.. 동의?? 우리의 추억은.. 값으로도 매길 수 없는 경험입니다.. 1년 뒤, 10년뒤, 50년 뒤에도 우리의 행복했던 이 순간을 까먹지 말고 소중히 간직하시길..\"}],\"photo\":[{\"author\":\"aYifMw4yF8Re3GBtmlHETguD3yD2\",\"content\":\"12924/images/aYifMw4yF8Re3GBtmlHETguD3yD2.jpg\"},{\"author\":\"bJmg0eO8dbgdsOm7jTMbx1pEYvZ2\",\"content\":\"12924/images/bJmg0eO8dbgdsOm7jTMbx1pEYvZ2.jpg\"},{\"author\":\"k1PVQUplAeb9PZSvAB3Wf4rwLJq2\",\"content\":\"12924/images/k1PVQUplAeb9PZSvAB3Wf4rwLJq2.jpg\"},{\"author\":\"GLkKCvqBvzOTKbh5TRNoXFlqHtu1\",\"content\":\"12924/images/GLkKCvqBvzOTKbh5TRNoXFlqHtu1.jpg\"},{\"author\":\"Kcz09sGqW6NjDAmcqIiNQX9KlbF3\",\"content\":\"12924/images/Kcz09sGqW6NjDAmcqIiNQX9KlbF3.jpg\"}],\"audio\":[{\"author\":\"aYifMw4yF8Re3GBtmlHETguD3yD2\",\"content\":\"12924/audios/aYifMw4yF8Re3GBtmlHETguD3yD2.mp4\"}],\"video\":[{\"author\":\"aYifMw4yF8Re3GBtmlHETguD3yD2\",\"content\":\"12924/videos/aYifMw4yF8Re3GBtmlHETguD3yD2.mp4\"},{\"author\":\"Kcz09sGqW6NjDAmcqIiNQX9KlbF3\",\"content\":\"12924/videos/Kcz09sGqW6NjDAmcqIiNQX9KlbF3.mp4\"}]}','2022-11-18 06:23:04.106602',NULL,'{\"teamName\":\"떡잎방범대\",\"hostUid\":\"bJmg0eO8dbgdsOm7jTMbx1pEYvZ2\",\"member\":[{\"nickname\":\"낙낙\",\"uid\":\"tcHwjUMYQpM0010rFk9o27UcHSi1\"},{\"nickname\":\"잠송\",\"uid\":\"aYifMw4yF8Re3GBtmlHETguD3yD2\"},{\"nickname\":\"연다\",\"uid\":\"bJmg0eO8dbgdsOm7jTMbx1pEYvZ2\"},{\"nickname\":\"영제\",\"uid\":\"k1PVQUplAeb9PZSvAB3Wf4rwLJq2\"},{\"nickname\":\"옌\",\"uid\":\"GLkKCvqBvzOTKbh5TRNoXFlqHtu1\"},{\"nickname\":\"짤리\",\"uid\":\"Kcz09sGqW6NjDAmcqIiNQX9KlbF3\"}]}',_binary '\0','36.355314,127.298203','자율 프로젝트 끝!',_binary '\0','2022-11-21 00:00:00.000000',_binary '\0'),(12927,'null',NULL,NULL,'null',_binary '\0',NULL,NULL,_binary '\0',NULL,_binary '\0'),(12928,'{\"text\":[{\"author\":\"GLkKCvqBvzOTKbh5TRNoXFlqHtu1\",\"content\":\"ㅇㅇ\"}],\"photo\":[],\"audio\":[],\"video\":[]}','2022-11-18 08:10:10.262795',NULL,'{\"teamName\":\"ㅇㅇ\",\"hostUid\":\"GLkKCvqBvzOTKbh5TRNoXFlqHtu1\",\"member\":[{\"nickname\":\"ㅇ\",\"uid\":\"GLkKCvqBvzOTKbh5TRNoXFlqHtu1\"}]}',_binary '\0',NULL,'ㅇ',_binary '\0','2022-11-18 00:00:00.000000',_binary '\0'),(12930,'{\"text\":[{\"author\":\"yYNq6wAoZdWprXIHwpLFuVytSBp2\",\"content\":\"